import React from 'react';
import styled from 'styled-components';

const MainPage = () => {
  return (
    <MainContainer>
      <ClipPathGroup>
        <Frame>
          <NamazVakitleri>Namaz Vakitleri</NamazVakitleri>
          <Frame1>
            <Button>
              <Imsak>İmsak</Imsak>
              <TimeSpan>05:46</TimeSpan>
            </Button>
            <FrameDiv>
              <SunSpan>Güneş</SunSpan>
              <TimeSpan2>07:10</TimeSpan2>
            </FrameDiv>
            <FrameDiv3>
              <NoonSpan>Öğle</NoonSpan>
              <TimeSpan4>13:18</TimeSpan4>
            </FrameDiv3>
            <FrameButton>
              <SpanIkindi>İkindi</SpanIkindi>
              <SpanTime>16:37</SpanTime>
            </FrameButton>
            <FrameDiv5>
              <SpanAksam>Akşam</SpanAksam>
              <SpanTime6>19:16</SpanTime6>
            </FrameDiv5>
            <FrameDiv7>
              <Frame8>
                <SpanYatsi>Yatsı</SpanYatsi>
                <SpanColon>20:36</SpanColon>
              </Frame8>
            </FrameDiv7>
          </Frame1>
        </Frame>
        <Group>
          <ClipPathGroup9>
            <GroupA>
              <Rectangle />
            </GroupA>
          </ClipPathGroup9>
        </Group>
        <Object />
        <FrameB>
          <SpanDate>14 Mart 2024 / 4 Ramazan 1445</SpanDate>
          <Colon>22:46</Colon>
          <Location>Fatih, İstanbul</Location>
        </FrameB>
      </ClipPathGroup>
    </MainContainer>
  );
};

const MainContainer = styled.div`
  overflow: hidden;
  width: 374px;
  height: 912px;
  margin: 0 auto;
  background: linear-gradient(120.1deg, #45009d, #004e87);
  * {
    box-sizing: border-box;
  }
  input,
  select,
  textarea,
  button {
    outline: 0;
  }
`;

const ClipPathGroup = styled.div`
  position: relative;
  width: 374px;
  height: 912px;
  overflow: visible auto;
`;

const Frame = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  gap: 15px;
  position: relative;
  width: 184px;
  margin: 121px 0 0 166px;
`;

const NamazVakitleri = styled.span`
  display: flex;
  align-items: flex-start;
  justify-content: center;
  width: 130px;
  height: 11px;
  color: #373737;
  font-family: Poppins, var(--default-font-family);
  font-size: 16px;
  font-weight: 600;
  line-height: 11px;
  text-align: center;
`;

const Frame1 = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  gap: 15px;
  position: relative;
  width: 184px;
`;

const Button = styled.button`
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 10.968px;
  width: 64px;
  padding: 10.968px;
  cursor: pointer;
  background: rgba(255, 255, 255, 0.8);
  border: none;
  border-radius: 13px;
  box-shadow: 0 4px 4px rgba(0, 0, 0, 0.06);
`;

const Imsak = styled.span`
  height: 9px;
  color: #373737;
  font-family: Poppins, var(--default-font-family);
  font-size: 13px;
  font-weight: 400;
  line-height: 9px;
  text-align: left;
`;

const TimeSpan = styled.span`
  height: 10px;
  color: #373737;
  font-family: Poppins, var(--default-font-family);
  font-size: 14.6px;
  font-weight: 400;
  line-height: 10px;
  text-align: left;
`;

const FrameDiv = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 10.968px;
  width: 64px;
  padding: 10.968px;
  background: rgba(255, 255, 255, 0.8);
  border-radius: 13px;
  box-shadow: 0 4px 4px rgba(0, 0, 0, 0.06);
`;

const SunSpan = styled.span`
  height: 9px;
  color: #373737;
  font-family: Poppins, var(--default-font-family);
  font-size: 13px;
  font-weight: 400;
  line-height: 9px;
  text-align: left;
`;

const TimeSpan2 = styled.span`
  height: 10px;
  color: #373737;
  font-family: Poppins, var(--default-font-family);
  font-size: 14.6px;
  font-weight: 400;
  line-height: 10px;
  text-align: left;
`;

const FrameDiv3 = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 10.968px;
  width: 64px;
  padding: 10.968px;
  background: rgba(255, 255, 255, 0.8);
  border-radius: 13px;
  box-shadow: 0 4px 4px rgba(0, 0, 0, 0.06);
`;

const NoonSpan = styled.span`
